function App() {
	const [active, setActive] = useState(0)

	return (
		<AppStyled bg={bg} className="App">
			<Orb></Orb>
			<MainLayout>
				<h1 id="app-title">Expense Tracker </h1>
				<Navigation />
			</MainLayout>
